import React, { Component } from 'react';
import SearchBox from '../components/SearchBox';

class HomePage extends Component {
    constructor(props) {
        super(props);
        this.state = {
            properties: props.location.state || [],
        };
    }

    componentDidMount() {
        
    }

    updateProperties = (properties) => {
        this.setState({ properties });
    }

    render() {
        return (
            <div>
                <SearchBox updateProperties={this.updateProperties} />
                {this.state.properties.map(property => (
                    <div key={property.id}>
                        <h2>{property.hotelName}</h2>
                        <p>{property.price}</p>
                    </div>
                ))}
            </div>
        );
    }
}

export default HomePage;
